import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";
import Inicio from "./Inicio";
function App (){
return <>
<Router>
  <nav>
    <ul>
      <li>
      <NavLink to="/inicio" className="a">
                    Inicio
                  </NavLink>
      </li>
    </ul>
  </nav>
<Route path="/inicio" exact element={ <Inicio />} />

</Router>




</>

}
export default App;
